// SPDX-License-Identifier: MIT
pragma solidity >=0.8.12 <0.9.0;

import {Ownable} from "../abstract/Ownable.sol";

import {DATABASE_KEY} from "../constant/SecretKey.sol";

import {Profile} from "../struct/employee/EmployeeStruct.sol";

contract ListEmployee is Ownable {
    mapping(uint256 => Profile) private list;
    uint256 private autoIncrement = 0;

    constructor() Ownable() {}

    event Add(Profile item);

    event Remove(Profile item);

    modifier requestSecretkey(bytes32 value) {
        require(
            value == DATABASE_KEY,
            "Database ListEmployee: Secret key error"
        );
        _;
    }

    modifier validIndex(uint256 index) {
        require(
            (1 <= index) && (index <= autoIncrement),
            "Database ListEmployee: Invalid index"
        );
        _;
    }

    function getLength(bytes32 secret)
        public
        view
        requestSecretkey(secret)
        returns (uint256)
    {
        return autoIncrement;
    }

    function add(Profile memory item, bytes32 secret)
        public
        requestSecretkey(secret)
        returns (bool)
    {
        autoIncrement++;
        item.id = autoIncrement;
        list[autoIncrement] = item;
        emit Add(item);
        return true;
    }

    function at(uint256 index, bytes32 secret)
        public
        view
        requestSecretkey(secret)
        validIndex(index)
        returns (Profile memory)
    {
        // require(index < list.length, "index must be less than list length");
        return list[index];
    }

    function findIdByAddress(address value, bytes32 secret)
        public
        view
        requestSecretkey(secret)
        returns (uint256)
    {
        for (uint256 i = 1; i <= autoIncrement; i++) {
            if (list[i].user == value) return list[i].id;
        }
        return 0;
    }

    function atAddress(address value, bytes32 secret)
        public
        view
        requestSecretkey(secret)
        returns (Profile memory)
    {
        for (uint256 i = 1; i <= autoIncrement; i++) {
            if (list[i].user == value) return list[i];
        }
        revert("Database ListEmployee: Invalid address");
    }

    // function remove(uint256 index) public returns (bool) {
    //     require(index < list.length, "index must be less than list length");
    //     delete list[index];
    //     list[index] = list[list.length - 1];
    //     list.pop();
    //     return true;
    // }

    function hide(uint256 index, bytes32 secret)
        public
        requestSecretkey(secret)
        validIndex(index)
        returns (bool)
    {
        Profile memory gap = Profile(
            0,
            0,
            0,
            address(0),
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            ""
        );
        list[index] = gap;
        return true;
    }

    // setter //////////////////////////////////////////////////////////////////////////
    function setCategory(
        uint256 index,
        bytes32 secret,
        uint256 value
    ) public requestSecretkey(secret) validIndex(index) returns (bool) {
        list[index].catergory = value;
        return true;
    }

    function setId(
        uint256 index,
        bytes32 secret,
        uint256 value
    ) public requestSecretkey(secret) validIndex(index) returns (bool) {
        list[index].id = value;
        return true;
    }

    function setIdCardNumber(
        uint256 index,
        bytes32 secret,
        uint256 value
    ) public requestSecretkey(secret) validIndex(index) returns (bool) {
        list[index].idCardNumber = value;
        return true;
    }

    function setUser(
        uint256 index,
        bytes32 secret,
        address value
    ) public requestSecretkey(secret) validIndex(index) returns (bool) {
        list[index].user = value;
        return true;
    }

    function setName(
        uint256 index,
        bytes32 secret,
        string memory value
    ) public requestSecretkey(secret) validIndex(index) returns (bool) {
        list[index].name = value;
        return true;
    }

    function setPhone(
        uint256 index,
        bytes32 secret,
        string memory value
    ) public requestSecretkey(secret) validIndex(index) returns (bool) {
        list[index].phone = value;
        return true;
    }

    function setProfessional(
        uint256 index,
        bytes32 secret,
        string memory value
    ) public requestSecretkey(secret) validIndex(index) returns (bool) {
        list[index].professional = value;
        return true;
    }

    function setEmail(
        uint256 index,
        bytes32 secret,
        string memory value
    ) public requestSecretkey(secret) validIndex(index) returns (bool) {
        list[index].email = value;
        return true;
    }

    function setGithub(
        uint256 index,
        bytes32 secret,
        string memory value
    ) public requestSecretkey(secret) validIndex(index) returns (bool) {
        list[index].github = value;
        return true;
    }

    function setLinkedin(
        uint256 index,
        bytes32 secret,
        string memory value
    ) public requestSecretkey(secret) validIndex(index) returns (bool) {
        list[index].linkedin = value;
        return true;
    }

    function setSourceImage(
        uint256 index,
        bytes32 secret,
        string memory value
    ) public requestSecretkey(secret) validIndex(index) returns (bool) {
        list[index].sourceImage = value;
        return true;
    }

    function setPassword(
        uint256 index,
        bytes32 secret,
        string memory value
    ) public requestSecretkey(secret) validIndex(index) returns (bool) {
        list[index].password = value;
        return true;
    }
}

