// SPDX-License-Identifier: MIT
pragma solidity >=0.8.14 <0.9.0;
struct Profile {
    uint256 catergory;
    uint256 id;
    uint256 idCardNumber;
    address user;
    string name;
    string phone;
    string professional;
    string email;
    string github;
    string linkedin;
    string sourceImage;
    string password;
}

